import React from 'react';
import logo from './logo.svg';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import Layout from './hoc/Layout/Layout';
import { Section } from './components/Section/Section';
import { LandingScreen } from './components/LandingScreen/LandingScreen';

const about = `I am a 2nd year computer engineering student at the University of Waterloo pursuing a hardware and software path. I have experience working on various kinds of projects, ranging from architectural oriented to software. I have interest in various aspects of software development as well as hardware design.`
const App: React.FC = () => {
    return (
        <div className="App">
            <Layout>
              <LandingScreen/>
              <Section title="About" content="hello hello hello" colour="blue"/>
              <Section title="Projects" content="hello hello hello" colour="blue"/>
              <Section title="Contact" content="hello hello hello" colour="blue"/>
            </Layout>
        </div>
    );
};

export default App;
